If you meant to type "sdiv", I believe you might be referring to "sdiv" as in "split div". A split div is a common technique used in web development to divide a container into multiple sections or regions.

Here's a simple example of how you could use a split div in HTML and CSS:

HTML:
```html
<div class="split-div">
  <div class="left-section">Left Section</div>
  <div class="right-section">Right Section</div>
</div>
```

CSS:
```css
.split-div {
  display: flex;
}

.left-section {
  width: 50%;
  background-color: #f2f2f2;
}

.right-section {
  width: 50%;
  background-color: #f2f2f2;
}
```

In this example, the `.split-div` container is divided into two sections, `.left-section` and `.right-section`, using the `display: flex` property. The `width` property is used to set the width of each section to 50%.

